import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import logo from '../assets/logo.png';

const Styles = styled.div`
  a,
  .navbar-brand,
  .navbar-nav .nav-link {
    font-weight: bold;
    color: #4a536b;

    &:hover {
      color: #ff9a8d;
      text-decoration: none;
    }
  }

  img {
      height: 65px;
  }
`;

export default function Cart() {
  return (
    <Styles>
        <div class="col-md-6 col-lg-4 col-xl-3">
      <div class="cart">
        <div class="row">
          <div class="col-12 image">
            <Link to="/">
                <img src={logo} alt="Logo" />
            </Link>
          </div>
          <h5 class="col-12 title">
            <Link to="/">Anasayfa</Link>
          </h5>
          <div class="col-12 text">
            Müslümanların üzerine farz kılınan ibadetlerden biri de zekâttır.
            Zekât yardımlaşma demektir, ümmet...
          </div>
          <div class="col-12 mt-auto">
            <div class="row buttons">
              <div class="col-6">
                <button type="button" class="btn button-third">
                  DETAY
                </button>
              </div>
              <div class="col-6">
                <button type="button" class="btn button-fourth">
                  BAĞIŞ YAP
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
    </Styles>
    
  );
}
